import React from 'react'
import ScrollableList from 'react-scrollable-list'
import "../Styles/Checkout.css"
import { Button, Form, FormGroup, Input, Row, Col } from 'reactstrap';
import { useSelector } from 'react-redux';
import { useState } from 'react';
import CartProduct from './CartProduct';

function Checkout(){

    const cartItems = useSelector((state) => state.CartReducer.cartItems);
    const total = useSelector((state) => state.CartReducer.total);
    const[firstName, setFirstName] = useState('');
    const[lastName, setLastName] = useState('');
    const[streetAddress, setStreetAddress] = useState('');
    const[aptOrSuite, setaptOrSuite] = useState('');
    const[city, setCity] = useState('');
    const[postCode, setPostCode] = useState('');
    const[state, setState] = useState('');


    const generateItemsList = () =>{
        let items = [];
        if(cartItems.length >= 1)
           items =  cartItems.map(p =>{
                return(
                    <CartProduct key={p.brandId} product={p}/>
                )
            }) 

        return cartItems;
    }

    

    
    const handleFormChange = (type,e) =>{
        e.preventDefault();
        switch (type) {
            case 'firstName':
                setFirstName(e.target.value);
                break;
            case 'lastName':
                setLastName(e.target.value);
                break;
            case 'streetAddress':
                setStreetAddress(e.target.value);
                break;
            case 'aptOrSuite':
                setaptOrSuite(e.target.value);
                break;
            case 'city':
                setCity(e.target.value);
                break;
            case 'postCode':
                setPostCode(e.target.value);
                break;
            case 'state':
                setState(e.target.value);
                break;
            default:
                break;
        }
    }

    return(
        <div className='checkout-container'>
            <div className='form-container' style={{backgroundColor:'green', width:'40%'}}>
                <h5>Shipping</h5>
                <Form className='form'>
                    <Row>
                        <Col md={6}>
                            <FormGroup >
                                <Input type="text" value={firstName} onChange={(e) => handleFormChange('firstName', e)} placeholder="First Name"></Input>
                            </FormGroup>
                        </Col>
                        <Col md={6}>
                            <FormGroup >
                                <Input type="text" value={lastName} onChange={(e) => handleFormChange('lastName',e)} placeholder="Last Name"></Input>
                            </FormGroup>
                        </Col>
                    </Row>
                    <Row>
                        <FormGroup>
                            <Input type="text" value={streetAddress} onChange={(e) => handleFormChange('streetAddress',e)} placeholder='Street Address'></Input>
                        </FormGroup>
                    </Row>
                    <Row>
                        <FormGroup>
                            <Input type="number" value={aptOrSuite} onChange={(e) => handleFormChange('aptOrSuite',e)} placeholder="Apt/Suite/(Optional)"></Input>
                        </FormGroup>
                    </Row>
                    <Row>
                        <Col>
                            <FormGroup>
                                <Input type="text" value={city} onChange={(e) => handleFormChange('city',e)} placeholder='City'></Input>
                            </FormGroup>
                        </Col>
                        <Col>
                            <FormGroup>
                                <Input type="text" value={state} onChange={(e) => handleFormChange('state',e)} placeholder='State'></Input>
                            </FormGroup>
                        </Col>
                    </Row>
                    <Row>
                        <FormGroup>
                            <Input type="text" value={postCode} onChange={(e) => handleFormChange('postCode',e)} placeholder='Postal Code'></Input>
                        </FormGroup>
                    </Row>
                </Form>
            </div>
            <div className='summary-container'>
                <div className='summary-details'>
                    <h3>OrderSummary</h3>
                    <p></p>
                </div>
                <div className='products-list'>
                <span>Items</span>
                <ScrollableList
                    listItems = {generateItemsList}
                />
                
                
                </div>
            </div>
            
            {/* <div className='cart-container'>
            <div className='cart-box'>
                <h2>Cart Summary</h2>
                {cartItems.length >= 1 ? 
                    cartItems.map(p =>{
                        return(
                            <CartProduct key={p.brandId} product={p}/>
                        )
                    })
                : <h5>Cart is empty</h5>}  
                <div className="check-out">
                    <span>Shipping and taxes calculated at check out</span>
                    <p className='order-total-tag' style={{fontWeight:'bold'}}>Order Total = ${total.toFixed(2)} </p>
                    <Button color='warning' className='check-out-btn'>Checkout</Button>
                    
                </div>
            </div>
            
        </div> */}
        </div>
    )
}

export default Checkout;
